import React from "react";
import { isEmpty } from "../../utils/index";

const List = ({ paroisses }) => {
  return (
    <div className="list-paroisses-container">
      {!isEmpty(paroisses) &&
        paroisses.map((paroisse) => {
          return (
            <div className="list-paroisse-element">
              <div className="paroisse-element-left"></div>
              <div className="paroisse-element-right">
                <p>{paroisse.name}</p>
                <p>{paroisse.diocese}</p>
              </div>
            </div>
          );
        })}
    </div>
  );
};

export default List;
